export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:e,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:e,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:e,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},"5WrBdy4gri":{data:{id:2740,attributes:{imdbId:"tt2953250",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjgxODZkYzAtZmY4Ni00ODA2LWEwZTQtNzgyN2E2ZTdhNzc2XkEyXkFqcGdeQXVyODk4OTc3MTY@._V1_SX300.jpg",type:d,ratings:[],item_lang:{data:{id:3407,attributes:{title:"Shining Girls",plot:"Years after a brutal attack left her in a constantly shifting reality, Kirby Mazrachi learns that a recent murder is linked to her assault. She teams with a veteran reporter to understand her ever-changing present and confront her past.",slug:"shining-girls"}}},books:{data:[{id:13036,attributes:{title:f,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:g,subtitle:l}},{id:13037,attributes:{title:f,description:"Chicago, 1931. Prima di trovare la Casa Harper Curtis era uno dei tanti vagabondi in una città schiacciata dalla Depressione. Poi una voce lo attira in quella che sembra solo una villa in rovina, e la sua vita cambia per sempre. Le porte della Casa permettono di viaggiare nel tempo e lui incomincia ad assaporare le meraviglie del futuro. Ma Harper Curtis è anche un uomo violento e crudele, un sadico, e a farne le spese sono giovani donne, forti, indipendenti e ricche di talento. Ogni giorno, nella sua testa i loro nomi riecheggiano, si ripetono, bruciano e splendono come stelle. Come un cacciatore Harper le insegue attraverso le epoche, scovandole da bambine e tornando a ucciderle quando sono sbocciate, al culmine del loro splendore. Ora Harper Curtis è l’assassino perfetto, non può essere scoperto né fermato. O almeno, così crede. Chicago, 1992. Quello che non ti uccide ti rende più forte. Kirby Mazrachi ha imparato bene la lezione da quando è stata assalita ed è sopravvissuta per miracolo. Il suo aggressore non è mai stato identificato. Nonostante il trauma emotivo, ha deciso che non vuole rimanere una vittima: l’unico modo per farlo è trovare chi l’ha attaccata e fermarlo. Il suo unico alleato è Dan, il giornalista che ha seguito il suo caso dopo l’aggressione. Lentamente, Kirby si rende conto che l’uomo a cui sta dando la caccia non è un semplice maniaco. Molte, troppe ragazze sono state uccise a Chicago, una scia di morte che si allunga così indietro negli anni che non può essere opera di una sola mano. E ogni volta sulla scena del delitto sono stati trovati oggetti che non hanno spiegazione. Come può Kirby trovare e catturare un uomo che non esiste?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VSNhDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Beukes Lauren"],firstBook:c,published:"2013-10-16",publisher:"Il Saggiatore",subtitle:a}},{id:13038,attributes:{title:f,description:i,thumbnail:j,authors:[b],firstBook:c,published:k,publisher:g,subtitle:l}},{id:13039,attributes:{title:"The Shining Girl",description:a,thumbnail:a,authors:[b],firstBook:c,published:"2020-01-01",publisher:a,subtitle:a}},{id:13040,attributes:{title:"Broken Monsters",description:"A criminal mastermind creates violent tableaus in abandoned Detroit warehouses in Lauren Beukes's genre-bending novel of suspense. Detective Gabriella Versado has seen a lot of bodies. But this one is unique even by Detroit's standards: half boy, half deer, somehow fused together. As stranger and more disturbing bodies are discovered, how can the city hold on to a reality that is already tearing at its seams? If you're Detective Versado's geeky teenage daughter, Layla, you commence a dangerous flirtation with a potential predator online. If you're desperate freelance journalist Jonno, you do whatever it takes to get the exclusive on a horrific story. If you're Thomas Keen, known on the street as TK, you'll do what you can to keep your homeless family safe -- and find the monster who is possessed by the dream of violently remaking the world. If Lauren Beukes's internationally bestselling The Shining Girls was a time-jumping thrill ride through the past, her Broken Monsters is a genre-redefining thriller about broken cities, broken dreams, and broken people trying to put themselves back together again. \"Scary as hell and hypnotic. I couldn't put it down...I'd grab it if I were you.\" -- Stephen King",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=2JltBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2014-09-16",publisher:g,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309098561}}("","Lauren Beukes",null,"series","movie","The Shining Girls","Hachette UK",1,"A masterful twist on the serial killer novel from the award-winning author Lauren Beukes: the girl who wouldn't die hunts the killer who shouldn't exist. Harper Curtis is a killer who stepped out of the past. Kirby Mazrachi is the girl who was never meant to have a future. Kirby is the last shining girl, one of the bright young women, burning with potential, whose lives Harper is destined to snuff out after he stumbles on a House in Depression-era Chicago that opens on to other times. At the urging of the House, Harper inserts himself into the lives of these shining girls, waiting for the perfect moment to strike. He's the ultimate hunter, vanishing without a trace into another time after each murder -- until one of his victims survives. Determined to bring her would-be killer to justice, Kirby joins the Chicago Sun-Times to work with the reporter, Dan Velasquez, who covered her case. Soon Kirby finds herself closing in on an impossible truth . . .","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DI9cDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2013-06-04","A Novel"))